import React from 'react';

const LoginPage = () => {
  const styles = {
    container: {
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      height: '100vh',
      backgroundColor: '#f5f5f5',
    },
    card: {
      display: 'flex',
      width: '80%',
      maxWidth: '1200px',
      height: '500px',
      borderRadius: '8px',
      overflow: 'hidden',
      boxShadow: '0 4px 8px rgba(10, 238, 143, 0.1)',
    },
    imageContainer: {
      flex: '0 0 40%',
      backgroundImage: 'url(https://t4.ftcdn.net/jpg/02/11/04/53/360_F_211045328_HnemU2NVFNwDWnQtDi5JHeHVhMV1jTOr.jpg)',
      backgroundSize: 'cover',
      backgroundPosition: 'center',
    },
    formContainer: {
      flex: '0 0 60%',
      backgroundColor: '#fff',
      padding: '2rem',
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'center',
    },
    title: {
      fontSize: '24px',
      fontWeight: 'bold',
      marginBottom: '1.5rem',
      textAlign: 'center',
    },
    formGroup: {
      marginBottom: '1rem',
    },
    label: {
      display: 'block',
      marginBottom: '0.5rem',
      fontSize: '14px',
      color: '#333',
    },
    input: {
      width: '100%',
      padding: '0.8rem',
      border: '1px solid #ccc',
      borderRadius: '4px',
      fontSize: '14px',
    },
    button: {
      width: '100%',
      padding: '0.8rem',
      backgroundColor: '#34B3F1',
      color: '#fff',
      border: 'none',
      borderRadius: '4px',
      fontSize: '16px',
      cursor: 'pointer',
      marginTop: '1rem',
    },
    buttonHover: {
      backgroundColor: '#0056b3',
    },
    link: {
      marginTop: '1rem',
      textAlign: 'center',
      fontSize: '14px',
    },
  };

  return (
    <div style={styles.container}>
      <div style={styles.card}>
        {/* Left Side Image */}
        <div style={styles.imageContainer}></div>

        {/* Right Side Form */}
        <div style={styles.formContainer}>
          <h2 style={styles.title}>Login</h2>
          <form>
            <div style={styles.formGroup}>
              <label style={styles.label}>Username</label>
              <input type="text" placeholder="Enter your username" style={styles.input} />
            </div>
            <div style={styles.formGroup}>
              <label style={styles.label}>Password</label>
              <input type="password" placeholder="Enter your password" style={styles.input} />
            </div>
            <button type="submit" style={styles.button}>
              Login
            </button>
            <div style={styles.link}>
              <a href="#">Forgot Password?</a>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
